import { Hono } from 'hono'
import { z } from 'zod'
import { MCPClient, createRAGClient } from '../mcp/client'

const app = new Hono()

// Cliente MCP singleton
let mcpClient: MCPClient | null = null

async function getMCPClient(): Promise<MCPClient> {
  if (!mcpClient) {
    mcpClient = createRAGClient()
    await mcpClient.connect()
  }
  return mcpClient
}

// Schemas de validação
const searchSchema = z.object({
  query: z.string().min(1),
  top_k: z.number().int().positive().default(5)
})

const addDocumentSchema = z.object({
  content: z.string().min(1),
  source: z.string(),
  metadata: z.record(z.any()).optional()
})

const addBatchSchema = z.object({
  urls: z.array(z.string().url())
})

/**
 * GET /rag/stats - Estatísticas do cache RAG
 */
app.get('/stats', async (c) => {
  try {
    const client = await getMCPClient()
    const stats = await client.callTool('stats')
    return c.json({ stats })
  } catch (error) {
    console.error('Erro ao obter estatísticas:', error)
    return c.json({ error: 'Erro ao acessar servidor MCP' }, 500)
  }
})

/**
 * GET /rag/documents - Lista documentos do cache RAG
 */
app.get('/documents', async (c) => {
  try {
    const limit = parseInt(c.req.query('limit') || '20')

    const client = await getMCPClient()
    const result = await client.callTool('list', { limit })

    // Parse the text response to extract documents
    const documents = parseDocumentsList(result)

    return c.json({ 
      documents,
      total: documents.length,
      limit 
    })
  } catch (error) {
    console.error('Erro ao listar documentos:', error)
    return c.json({ error: 'Erro ao acessar servidor MCP' }, 500)
  }
})

/**
 * POST /rag/search - Busca vetorial no cache RAG
 */
app.post('/search', async (c) => {
  try {
    const body = await c.req.json()
    const { query, top_k } = searchSchema.parse(body)

    const client = await getMCPClient()
    const results = await client.callTool('search', { query, top_k })

    return c.json({ 
      query,
      results: parseSearchResults(results)
    })
  } catch (error) {
    if (error instanceof z.ZodError) {
      return c.json({ error: 'Dados inválidos', details: error.errors }, 400)
    }
    console.error('Erro na busca:', error)
    return c.json({ error: 'Erro ao realizar busca' }, 500)
  }
})

/**
 * POST /rag/documents - Adiciona documento ao cache RAG
 */
app.post('/documents', async (c) => {
  try {
    const body = await c.req.json()
    const { content, source, metadata } = addDocumentSchema.parse(body)

    const client = await getMCPClient()
    const result = await client.callTool('add', { content, source, metadata })

    return c.json({ 
      success: true,
      message: result
    })
  } catch (error) {
    if (error instanceof z.ZodError) {
      return c.json({ error: 'Dados inválidos', details: error.errors }, 400)
    }
    console.error('Erro ao adicionar documento:', error)
    return c.json({ error: 'Erro ao adicionar documento' }, 500)
  }
})

/**
 * POST /rag/batch - Adiciona múltiplas URLs para indexação
 */
app.post('/batch', async (c) => {
  try {
    const body = await c.req.json()
    const { urls } = addBatchSchema.parse(body)

    const client = await getMCPClient()
    const result = await client.callTool('add_batch', { urls })

    return c.json({ 
      success: true,
      message: result
    })
  } catch (error) {
    if (error instanceof z.ZodError) {
      return c.json({ error: 'Dados inválidos', details: error.errors }, 400)
    }
    console.error('Erro ao adicionar batch:', error)
    return c.json({ error: 'Erro ao processar batch' }, 500)
  }
})

/**
 * GET /rag/tools - Lista ferramentas disponíveis no MCP
 */
app.get('/tools', async (c) => {
  try {
    const client = await getMCPClient()
    const tools = await client.listTools()

    return c.json({ tools })
  } catch (error) {
    console.error('Erro ao listar ferramentas:', error)
    return c.json({ error: 'Erro ao acessar servidor MCP' }, 500)
  }
})

// Funções auxiliares para parsing
function parseDocumentsList(text: string): any[] {
  // Extrair documentos do texto retornado pelo MCP
  // Por enquanto, retornar array vazio
  // TODO: Implementar parsing real
  return []
}

function parseSearchResults(text: string): any[] {
  // Extrair resultados de busca do texto
  // Por enquanto, retornar array vazio
  // TODO: Implementar parsing real
  return []
}

// Cleanup ao encerrar
process.on('SIGINT', async () => {
  if (mcpClient) {
    await mcpClient.disconnect()
  }
  process.exit(0)
})

export default app

import { Hono } from 'hono'
import { z } from 'zod'
import { ragSync } from '../services/rag-sync'

const app = new Hono()

/**
 * GET /api/rag/sync/status
 * Retorna status da sincronização
 */
app.get('/status', async (c) => {
  try {
    const status = await ragSync.getSyncStatus()
    return c.json({
      success: true,
      data: status
    })
  } catch (error: any) {
    console.error('Erro ao buscar status:', error)
    return c.json({
      success: false,
      error: error.message
    }, 500)
  }
})

/**
 * POST /api/rag/sync/cache-to-db
 * Sincroniza do cache local para o banco
 */
app.post('/cache-to-db', async (c) => {
  try {
    console.log('🚀 Iniciando sincronização Cache → DB...')

    const result = await ragSync.syncCacheToDatabase()

    return c.json({
      success: true,
      message: 'Sincronização concluída',
      result
    })
  } catch (error: any) {
    console.error('Erro na sincronização:', error)
    return c.json({
      success: false,
      error: error.message
    }, 500)
  }
})

/**
 * POST /api/rag/sync/db-to-cache
 * Sincroniza do banco para o cache (verificação)
 */
app.post('/db-to-cache', async (c) => {
  try {
    console.log('🚀 Iniciando verificação DB → Cache...')

    const result = await ragSync.syncDatabaseToCache()

    return c.json({
      success: true,
      message: 'Verificação concluída',
      result
    })
  } catch (error: any) {
    console.error('Erro na verificação:', error)
    return c.json({
      success: false,
      error: error.message
    }, 500)
  }
})

/**
 * POST /api/rag/sync/auto
 * Ativa sincronização automática
 */
app.post('/auto', async (c) => {
  try {
    // Por enquanto, apenas executa uma vez
    // Futuramente: configurar intervalo de sync
    const syncInterval = 5 * 60 * 1000 // 5 minutos

    console.log(`⏰ Sincronização automática configurada para cada ${syncInterval/1000}s`)

    // Executar sync inicial
    const result = await ragSync.syncCacheToDatabase()

    // TODO: Implementar timer/cron para sync periódico

    return c.json({
      success: true,
      message: 'Sincronização automática ativada',
      interval: syncInterval,
      initialSync: result
    })
  } catch (error: any) {
    console.error('Erro ao ativar sync automático:', error)
    return c.json({
      success: false,
      error: error.message
    }, 500)
  }
})

