    method = request.get('method')
    params = request.get('params', {})

    if method == 'tools/list':
        return {
            'tools': [
                {
                    'name': 'search',
                    'description': 'Busca documentos relevantes no cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'query': {'type': 'string', 'description': 'Texto de busca'},
                            'limit': {'type': 'number', 'description': 'Número máximo de resultados', 'default': 5}
                        },
                        'required': ['query']
                    }
                },
                {
                    'name': 'add',
                    'description': 'Adiciona documento ao cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'title': {'type': 'string'},
                            'content': {'type': 'string'},
                            'type': {'type': 'string'},
                            'source': {'type': 'string'}
                        },
                        'required': ['title', 'content']
                    }
                },
                {
                    'name': 'remove',
                    'description': 'Remove documento do cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'id': {'type': 'string', 'description': 'ID do documento'}
                        },
                        'required': ['id']
                    }
                },
                {
