                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'success': True,
                                'document': document
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'remove':
                success = searcher.remove_document(args['id'])
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'success': success,
                                'id': args['id']
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'list':
                documents = searcher.list_documents()
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'documents': documents,
                                'total': len(documents)
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'stats':
                stats = searcher.get_stats()
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps(stats, ensure_ascii=False)
                        }
                    ]
                }

