    """Loop principal do servidor MCP"""
    print("Simple MCP RAG Server iniciando...", file=sys.stderr)
    print(f"Cache: {CACHE_PATH}", file=sys.stderr)
    print(f"Documentos: {len(searcher.documents)}", file=sys.stderr)

    # Envia capacidades iniciais
    capabilities = {
        'jsonrpc': '2.0',
        'id': 0,
        'result': {
            'protocolVersion': '2024-11-05',
            'capabilities': {
                'tools': {}
            },
            'serverInfo': {
                'name': 'simple-rag-server',
                'version': '1.0.0'
            }
        }
    }

    print(json.dumps(capabilities))
    sys.stdout.flush()

    # Loop de processamento
    while True:
        try:
            line = sys.stdin.readline()
            if not line:
                break

            request = json.loads(line.strip())

            # Processa requisição
            result = handle_request(request)

            # Envia resposta
            response = {
                'jsonrpc': '2.0',
                'id': request.get('id'),
                'result': result
            }

            print(json.dumps(response))
            sys.stdout.flush()

        except json.JSONDecodeError:
            continue
        except Exception as e:
            error_response = {
                'jsonrpc': '2.0',
                'id': request.get('id') if 'request' in locals() else None,
                'error': {
                    'code': -32603,
                    'message': str(e)
                }
            }
            print(json.dumps(error_response))
            sys.stdout.flush()

if __name__ == '__main__':
    main()

