#!/usr/bin/env python3
"""
MCP RAG Server - Versão corrigida sem dependências externas
"""
import json
import sys
import os
from pathlib import Path
from typing import Dict, List, Any
import re
from collections import Counter
import math

# Cache path
CACHE_PATH = Path.home() / ".claude" / "mcp-rag-cache"
CACHE_FILE = CACHE_PATH / "documents.json"

class SimpleRAGSearcher:
    def __init__(self):
        self.documents = []
        self.load()

    def load(self):
        """Carrega documentos do arquivo JSON"""
        if CACHE_FILE.exists():
            try:
                with open(CACHE_FILE, 'r', encoding='utf-8') as f:
                    data = json.load(f)
                    self.documents = data.get('documents', [])
            except:
                self.documents = []

        print(f"Carregados {len(self.documents)} documentos", file=sys.stderr)

    def save(self):
        """Salva documentos no arquivo JSON"""
        CACHE_PATH.mkdir(parents=True, exist_ok=True)
        with open(CACHE_FILE, 'w', encoding='utf-8') as f:
            json.dump({'documents': self.documents}, f, ensure_ascii=False, indent=2)

    def tokenize(self, text: str) -> List[str]:
        """Tokeniza texto em palavras"""
        text = text.lower()
        # Remove pontuação e divide em palavras
        words = re.findall(r'\b\w+\b', text)
        return words

    def calculate_tf_idf(self, query: str) -> List[Dict[str, Any]]:
        """Calcula TF-IDF simples para busca"""
        if not self.documents:
            return []

        query_words = self.tokenize(query)
        if not query_words:
            return []

        # Calcula IDF para cada palavra
        doc_count = len(self.documents)
        word_doc_count = Counter()

        # Conta em quantos documentos cada palavra aparece
        for doc in self.documents:
            content = f"{doc.get('title', '')} {doc.get('content', '')} {doc.get('type', '')}"
            words = set(self.tokenize(content))
            for word in words:
                word_doc_count[word] += 1

        # Calcula scores para cada documento
        scores = []
        for doc in self.documents:
            content = f"{doc.get('title', '')} {doc.get('content', '')} {doc.get('type', '')}"
            doc_words = self.tokenize(content)

            # Calcula TF-IDF score
            score = 0
            word_freq = Counter(doc_words)

            for query_word in query_words:
                if query_word in word_freq:
                    tf = word_freq[query_word] / len(doc_words) if doc_words else 0
                    idf = math.log(doc_count / (word_doc_count[query_word] + 1))
                    score += tf * idf

            if score > 0:
                scores.append({
                    'document': doc,
                    'score': score
                })

        # Ordena por score
        scores.sort(key=lambda x: x['score'], reverse=True)

        return scores[:10]  # Top 10 resultados

    def search(self, query: str, limit: int = 5) -> List[Dict[str, Any]]:
        """Busca documentos relevantes"""
        results = self.calculate_tf_idf(query)

        # Formata resultados
        formatted_results = []
        for result in results[:limit]:
            doc = result['document']
            formatted_results.append({
                'id': doc.get('id'),
                'title': doc.get('title'),
                'content': doc.get('content')[:200] + '...' if len(doc.get('content', '')) > 200 else doc.get('content'),
                'type': doc.get('type'),
                'source': doc.get('source'),
                'score': result['score']
            })

        return formatted_results

    def add_document(self, document: Dict[str, Any]) -> Dict[str, Any]:
        """Adiciona documento ao índice"""
        # Gera ID se não existir
        if 'id' not in document:
            import time
            document['id'] = f"doc_{int(time.time() * 1000)}"

        # Adiciona timestamp
        import datetime
        document['created_at'] = datetime.datetime.now().isoformat()

        self.documents.append(document)
        self.save()

        return document

    def remove_document(self, doc_id: str) -> bool:
        """Remove documento do índice"""
        # Encontra e remove documento
        for i, doc in enumerate(self.documents):
            if doc.get('id') == doc_id:
                self.documents.pop(i)
                self.save()
                return True

        return False

    def list_documents(self) -> List[Dict[str, Any]]:
        """Lista todos os documentos"""
        return [{
            'id': doc.get('id'),
            'title': doc.get('title'),
            'type': doc.get('type'),
            'source': doc.get('source'),
            'created_at': doc.get('created_at')
        } for doc in self.documents]

    def get_stats(self) -> Dict[str, Any]:
        """Retorna estatísticas do cache"""
        type_counts = Counter()
        source_counts = Counter()

        for doc in self.documents:
            type_counts[doc.get('type', 'unknown')] += 1
            source_counts[doc.get('source', 'unknown')] += 1

        return {
            'total_documents': len(self.documents),
            'types': dict(type_counts),
            'sources': dict(source_counts),
            'cache_file': str(CACHE_FILE),
            'cache_size_bytes': CACHE_FILE.stat().st_size if CACHE_FILE.exists() else 0
        }

# Instância global
searcher = SimpleRAGSearcher()

def handle_request(request):
    """Processa requisição MCP"""
    method = request.get('method')
    params = request.get('params', {})

    # Handle initialization
    if method == 'initialize':
        return {
            'protocolVersion': '2024-11-05',
            'capabilities': {
                'tools': {}
            },
            'serverInfo': {
                'name': 'mcp-rag-server',
                'version': '1.0.0'
            }
        }

    elif method == 'initialized':
        # Notification, no response needed
        return None

    elif method == 'tools/list':
        return {
            'tools': [
                {
                    'name': 'search',
                    'description': 'Busca documentos relevantes no cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'query': {'type': 'string', 'description': 'Texto de busca'},
                            'limit': {'type': 'number', 'description': 'Número máximo de resultados', 'default': 5}
                        },
                        'required': ['query']
                    }
                },
                {
                    'name': 'add',
                    'description': 'Adiciona documento ao cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'title': {'type': 'string'},
                            'content': {'type': 'string'},
                            'type': {'type': 'string'},
                            'source': {'type': 'string'}
                        },
                        'required': ['title', 'content']
                    }
                },
                {
                    'name': 'remove',
                    'description': 'Remove documento do cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {
                            'id': {'type': 'string', 'description': 'ID do documento'}
                        },
                        'required': ['id']
                    }
                },
                {
                    'name': 'list',
                    'description': 'Lista todos os documentos',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {}
                    }
                },
                {
                    'name': 'stats',
                    'description': 'Estatísticas do cache RAG',
                    'inputSchema': {
                        'type': 'object',
                        'properties': {}
                    }
                }
            ]
        }

    elif method == 'tools/call':
        tool_name = params.get('name')
        args = params.get('arguments', {})

        try:
            if tool_name == 'search':
                results = searcher.search(args['query'], args.get('limit', 5))
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'results': results,
                                'query': args['query'],
                                'total': len(results)
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'add':
                document = searcher.add_document({
                    'title': args['title'],
                    'content': args['content'],
                    'type': args.get('type', 'general'),
                    'source': args.get('source', 'manual')
                })
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'success': True,
                                'document': document
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'remove':
                success = searcher.remove_document(args['id'])
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'success': success,
                                'id': args['id']
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'list':
                documents = searcher.list_documents()
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps({
                                'documents': documents,
                                'total': len(documents)
                            }, ensure_ascii=False)
                        }
                    ]
                }

            elif tool_name == 'stats':
                stats = searcher.get_stats()
                return {
                    'content': [
                        {
                            'type': 'text',
                            'text': json.dumps(stats, ensure_ascii=False)
                        }
                    ]
                }

            else:
                return {
                    'error': {'message': f'Tool not found: {tool_name}'}
                }

        except Exception as e:
            return {
                'error': {'message': str(e)}
            }

    else:
        return {
            'error': {'message': f'Method not supported: {method}'}
        }

def main():
    """Loop principal do servidor MCP"""
    print("MCP RAG Server iniciando...", file=sys.stderr)
    print(f"Cache: {CACHE_PATH}", file=sys.stderr)
    print(f"Documentos: {len(searcher.documents)}", file=sys.stderr)

    # Loop de processamento
    while True:
        try:
            line = sys.stdin.readline()
            if not line:
                break

            request = json.loads(line.strip())

            # Processa requisição
            result = handle_request(request)

            # Se for notificação, não envia resposta
            if result is None:
                continue

            # Envia resposta
            response = {
                'jsonrpc': '2.0',
                'id': request.get('id'),
                'result': result
            }

            print(json.dumps(response))
            sys.stdout.flush()

        except json.JSONDecodeError:
            continue
        except Exception as e:
            error_response = {
                'jsonrpc': '2.0',
                'id': request.get('id') if 'request' in locals() else None,
                'error': {
                    'code': -32603,
                    'message': str(e)
                }
            }
            print(json.dumps(error_response))
            sys.stdout.flush()

if __name__ == '__main__':
    main()

